    "originalCode": "import React, { useState } from 'react';\n\nexport default function SimpleTabs() {\n  const [activeTab, setActiveTab] = useState('home');\n\n  const tabs = [\n    {\n      id: 'home',\n      label: 'üè† Home',\n      content: 'Welcome to the home page! This is where you\\'ll find the latest updates and news.'\n    },\n    {\n      id: 'about',\n      label: 'üë• About',\n      content: 'Learn more about our company, mission, and the team behind our products.'\n    },\n    {\n      id: 'services',\n      label: '‚öôÔ∏è Services',\n      content: 'Explore our range of services including web development, design, and consulting.'\n    },\n    {\n      id: 'contact',\n      label: 'üìû Contact',\n      content: 'Get in touch with us through email, phone, or visit our office location.'\n    }\n  ];\n\n  return (\n    <div style={{\n      display: 'flex',\n      flexDirection: 'column',\n      height: '100%',\n      backgroundColor: '#f8fafc',\n      fontFamily: 'system-ui, sans-serif'\n    }}>\n      {/* Tab Navigation */}\n      <div style={{\n        display: 'flex',\n        borderBottom: '2px solid #e5e7eb',\n        backgroundColor: 'white'\n      }}>\n        {tabs.map((tab) => (\n          <button\n            key={tab.id}\n            onClick={() => setActiveTab(tab.id)}\n            style={{\n              padding: '16px 24px',\n              border: 'none',\n              backgroundColor: 'transparent',\n              color: activeTab === tab.id ? '#6366f1' : '#6b7280',\n              fontSize: '16px',\n              fontWeight: '600',\n              cursor: 'pointer',\n              borderBottom: activeTab === tab.id ? '3px solid #6366f1' : '3px solid transparent',\n              transition: 'all 0.2s ease'\n            }}\n          >\n            {tab.label}\n          </button>\n        ))}\n      </div>\n\n      {/* Tab Content */}\n      <div style={{\n        flex: 1,\n        padding: '32px',\n        backgroundColor: 'white',\n        display: 'flex',\n        alignItems: 'center',\n        justifyContent: 'center'\n      }}>\n        <div style={{\n          maxWidth: '600px',\n          textAlign: 'center'\n        }}>\n          <h2 style={{\n            color: '#1e293b',\n            marginBottom: '16px',\n            fontSize: '24px'\n          }}>\n            {tabs.find(tab => tab.id === activeTab)?.label}\n          </h2>\n          <p style={{\n            color: '#6b7280',\n            fontSize: '16px',\n            lineHeight: '1.6'\n          }}>\n            {tabs.find(tab => tab.id === activeTab)?.content}\n          </p>\n        </div>\n      </div>\n    </div>\n  );\n}",
